import { Divider, Typography } from "@mui/material";
import Grid from '@mui/material/Unstable_Grid2';
import { useState } from "react";
import Button from "@mui/material/Button";
import ListingsCard from "../ListingsCard/ListingsCard";
import { Link } from "react-router-dom";
import dayjs from "dayjs";

export default function MyStuff(){

//write the api call, if u gotta move it no biggie

const api = `https://localhost:44305`;

const [user, setUser] = useState();
const [userLoaded, setUserLoaded] = useState(false);
const [listings, setListings] = useState();
const [listingsLoaded, setListingsLoaded] = useState(false);

const id = 1;   ///will change later when login stuff is hooked up.

const getUser = () => {

    fetch(`${api}/bnb/user${id}`)
    .then((response) => response.json())
    .then((data) => {
        setUser(data.user);
    })
    .then(() => {
        setUserLoaded(true);
    });
}
const getListings = () => {

    fetch(`${api}/bnb/listings`)
    .then((response) => response.json())
    .then((data) => {
  
        setListings(data.listings);
        console.log(data);
    })
    .then(() => {
        setListingsLoaded(true);
    });
}
const checkForData = () => {

    !userLoaded && getUser();
    !listingsLoaded && getListings();
}
checkForData();

const showMyListings = () => {

    return user.listings.map(function(val, index) {

        return(
            <div key={index}>
                <ListingsCard listing={val}/>
                <Link  style={{ textDecoration: 'none' }} to={`/listings/edit/${val.id}`}>
                    <Button variant="contained" sx={{":hover": {
                    bgcolor: "peachpuff"}, justifyContent:'right', backgroundColor:"lightsalmon", ml:3}}>Edit</Button>
                </Link>
            </div>
        )
    });
}
const showFavorites = () => {

    return user.favorites.map(function(val, index) {

        return(
            <div key={index}>
                <ListingsCard listing={val}/>
            </div>
        )
    });
}
const showUpcomingStays = () => {

    var upcomingStays = user.stays.filter(s => dayjs(s.endDate).isAfter(dayjs()));

    var stayListings = upcomingStays.map(function(val, index) {
        return(
            listings.find(l => l.id == val.listingId)
        )
    });

    return stayListings.map(function(val, index){

        return(
            <div key={index}>
                <ListingsCard listing={val}/>
            </div>
        )
    });
}
const showPastStays = () => {

    var pastStays = user.stays.filter(s => dayjs(s.endDate).isBefore(dayjs()));

    var stayListings = pastStays.map(function(val, index) {
        return(
            listings.find(l => l.id == val.listingId)
        )
    });

    return stayListings.map(function(val, index){

        return(
            <div key={index}>
                <ListingsCard listing={val}/>
                <Button variant="contained" sx={{":hover": {
                    bgcolor: "peachpuff"}, justifyContent:'right', backgroundColor:"lightsalmon", ml:3}}>Leave a Review!</Button>
            </div>
        )
    });
}

    return(
        <div>
            {userLoaded && listingsLoaded &&
                <div>
                    <Typography variant="h5" sx={{justifyContent: 'center', display: 'flex', m:2}}>Welcome, {user.username}</Typography>
                    <Typography variant="h5" sx={{ml:3}}>My Listings</Typography>
                    <Grid container sx={{mb:2}}>
                    {showMyListings()}
                    </Grid>

                    <Divider sx={{backgroundColor:'peachpuff'}}/>

                    <Typography variant="h5" sx={{ml:3, mt:2}}>My Favorites</Typography>
                    <Grid container sx={{mb:2}}>
                    {showFavorites()}
                    </Grid>

                    <Divider sx={{backgroundColor:'peachpuff'}}/>

                    <Typography variant="h5" sx={{ml:3, mt:2}}>Upcoming Stays</Typography>
                    <Grid container sx={{mb:2}}>
                    {showUpcomingStays()}
                    </Grid>

                    <Divider sx={{backgroundColor:'peachpuff'}}/>

                    <Typography variant="h5" sx={{ml:3, mt:2}}>Past Stays</Typography>
                    <Grid container sx={{mb:2}}>
                    {showPastStays()}
                    </Grid>
                </div>
            }
        </div>
    )
}
